def fibo(n, cal_n):
    if cal_n == 0:
        dp[n][0] += 1
        return 0
    elif cal_n == 1:
        dp[n][1] += 1
        return 0

    if dp[cal_n] != [0, 0]:
        dp[n][0] += dp[cal_n][0]
        dp[n][1] += dp[cal_n][1]
        return 0

    return fibo(n, cal_n - 1) + fibo(n, cal_n - 2)


