    if num == 1:
        print(cnt)
        break

    if num % 2 == 0:
        if not v[num // 2]:
            v[num // 2] = 1
            q.append((num // 2, cnt + 1))
    if num % 3 == 0:
        if not v[num // 3]:
            v[num // 3] = 1
            q.append((num // 3, cnt + 1))
    if num > 1:
        if not v[num - 1]:
            v[num - 1] = 1
            q.append((num - 1, cnt + 1))

