import sys

n, m = map(int, sys.stdin.readline().split())
arr = []
for _ in range(n):
    tmp = list(map(int, sys.stdin.readline().split()))
    arr.append(tmp)
dp = [[0 for _ in range(m)] for _ in range(n)]
first_sum = 0
for j in range(m):
    first_sum += arr[0][j]
    dp[0][j] = first_sum

for i in range(1, n):
    for j in range(m):
        dp[i][j] = dp[i-1][j] + arr[i][j]
    tmp1 = dp[i][:]
    tmp2 = dp[i][:]
    for j in range(1, m):
        tmp1[j] = max(tmp1[j-1]+arr[i][j], tmp1[j])
    for j in range(m-2, -1, -1):
        tmp2[j] = max(tmp2[j+1]+arr[i][j], tmp2[j])
    for j in range(m):
        dp[i][j] = max(tmp1[j], tmp2[j])
print(dp[n-1][m-1])

