v = [0 for _ in range(N+1)]

while q:
    num, sum, cnt = q.popleft()
    if sum == N:
        ans = cnt
        break

    if sum < N:
        for n in nums:
            if sum+n < N+1 and not v[sum+n]:
                v[sum+n] = 1
                q.append((num, sum+n, cnt+1))

