def dol_game(n):
    dp = [""] * (n + 1)  # dp 배열 생성
    dp[1] = "CY"  # 1개일 때 창영 승리
    if n >= 2:
        dp[2] = "SK"  # 2개일 때 상근 승리
    if n >= 3:
        dp[3] = "CY"  # 3개일 때 창영 승리
    if n >= 4:
        dp[4] = "SK"  # 4개일 때 상근 승리

    for i in range(5, n + 1):
        if dp[i - 1] == "CY" or dp[i - 3] == "CY":
            dp[i] = "SK"
        else:
            dp[i] = "CY"

    return dp[n]

