import heapq
import sys

input = sys.stdin.readline

N, K = map(int, input().replace("\n","").split())

heap = []

Q = deque()

board = [[0] * (N+1)] + [
    [0] + list(map(int,input().replace("\n","").split()))
    for _ in range(N)
]
visited = [
    [False] * (N+1)
    for _ in range(N+1)
]

for j in range(1,N+1) :
    for i in range(1,N+1) :
        if board[j][i] != 0 :
            heapq.heappush(heap,(board[j][i],j,i))

S, Y, X = map(int,input().replace("\n","").split())
while heap :
    _, y, x = heapq.heappop(heap)
    Q.append((y,x))
    visited[y][x] = True

dxs = [1,0,-1,0]
dys = [0,1,0,-1]
def bfs() :
    while Q :
        tmp,check = Q.popleft()
        if check == -1:
            if tmp == S :
                break
            else :
                Q.append((tmp + 1,check))
                continue
        y, x = tmp, check
        for dx, dy in zip(dxs, dys) :
            ny, nx = y + dy, x + dx 
            if 0 < ny <= N and 0 < nx <= N and visited[ny][nx] == False and board[ny][nx] == 0 :
                visited[ny][nx] = True
                board[ny][nx] = board[y][x]
                Q.append((ny,nx))

Q.append((1,-1))
bfs()
print(board[Y][X])

